Verenigde Staten
Komedie
116 minuten

een goeie film

met Ben Stiller, Michelle Monaghan en Malin Akerman

Na een serie van mislukte relaties begint Eddie Cantrow bijna de hoop op te geven om ooit nog getrouwd te raken. Daar komt 
echter verandering als hij de bloedmooie Lila ontmoet, die hij al na een aantal weken ten huwelijk vraagt. Alles lijkt op het 
eerste gezicht perfect totdat ze op huwelijksreis gaan in Cabo, waar hij er achter komt dat zij lang niet zo perfect is als hij 
dacht. Ook ontmoet hij er de mooie Miranda, die Eddie aan het twijfelen zet of het wel een goede zet was om met Lila te trouwen.
